import LinkComp from "../components/Link/index.js";
// import Button from "../components/Button/index";
import Router from "next/router";
import styled from "styled-components";

const Welcome = styled.h2`
  color: ${p => p.theme.text | "black"};
`;

const Descr = styled.p`
  color: ${p => p.theme.text | "#616161"};
`;

const Container = styled.span`
  text-align: center;
`;

const Divider = styled.div`
  display: inline-block;
`;

const Message = () => {
  return <Welcome>Welcome to Agit!</Welcome>;
};

const Description = () => {
  return (
    <Descr>
      We are dedicated to connecting customers to businesses that offer
      specials. 100% free, 100% accessible, 100% special.
    </Descr>
  );
};

const Index = () => {
  return (
    <Container>
      <Message></Message>
      <Description></Description>
      <Divider>
        <LinkComp to='/login'>Login to save favorites</LinkComp>
        <LinkComp to='/home'>Browse without logging in</LinkComp>
      </Divider>
    </Container>
  );
};

export default Index;
